description:
Dương Đình Nghệ 4500 24 200 1950 tỷ Cầu Giấy.


 - Diện tích đất: 4500 m2. 
- Vị trí vip, lô góc, 2 mặt đường, nhìn sang tổ hợp KeangNam và Đại lý Luxus Phạm Hùng. 
- Quy mô toà nhà: xây 3 tầng hầm và 21 tầng nổi tiêu chuẩn VP hạng A. 
- Thông số xây dựng: 
+ tổng S sàn 44.504 m2; 
+ tổng S sàn nổi: 33.434 m2; 
+ tổng S sàn hầm: 11.070 m2; + S xây dựng: 1.650 m2; - --+ MĐXD: 36,7%; chiều cao công trình: 87 m; 
+ Cấp công trình: cấp 1; bậc chịu lửa: bậc 1; 
- Chức năng: toà nhà hạng A tại VN. 
- Bố trí: hầm 1 - 3: để xe; 
+ Tầng 1 - T 6: phụ vụ hội thảo và dịch vụ thương mại. 
+ Tầng 7 - T 21: văn phòng làm việc. Đặc biệt: hội trường tại Tầng 2 có chiều cao 3 tầng có sức chứa 700 đến 1.000 chỗ ngồi. Phòng họp trực tuyến thông 2 tầng 5 và 6 có S 700 m2, có sức chứa 400 chỗ ngồi.
+ Sổ đỏ 50 năm.
+ Giá bán thương lượng.
+ Xem dự án liên hệ Msr Phương.
